import React, { useState } from 'react';
import { FaSearch, FaHome, FaList, FaShoppingBag, FaHistory } from 'react-icons/fa';
import './App.css'; // Create this file for styling

const placeholderImage = '/placeholder.png';

function App() {
  const [searchTerm, setSearchTerm] = useState('');
  const [searchResults, setSearchResults] = useState([]);
  const [selectedCategory, setSelectedCategory] = useState('Spices Or Masala'); // Default category

  // Sample data (replace with your actual data)
  const categoriesData = [
    { id: 1, name: 'Spices Or Masala', image: placeholderImage },
    { id: 2, name: 'Bathing Soaps', image: placeholderImage },
    { id: 3, name: 'Baby Care', image: placeholderImage },
    { id: 4, name: 'Hair Oil & Hair Cares', image: placeholderImage },
    { id: 5, name: 'Toothpaste & Toothbrush', image: placeholderImage },
    { id: 6, name: 'Shampoo & Dique Serums', image: placeholderImage },
    { id: 7, name: 'Perfumes', image: placeholderImage },
  ];

  const productsData = [
    { id: 1, name: 'Everest Turmeric 200 Gram', category: 'Spices Or Masala' },
    { id: 2, name: 'Patanjali Turmeric (Haldi) Powder', category: 'Spices Or Masala' },
    { id: 3, name: 'Patanjali Sabji Masala 100 Gram', category: 'Spices Or Masala' },
    { id: 4, name: 'Patanjali Cumin (Jeera) Powder', category: 'Spices Or Masala' },
    { id: 5, name: 'Dove Bathing Soap', category: 'Bathing Soaps' },
    // Add more products...
  ];

  const handleSearchChange = (event) => {
    setSearchTerm(event.target.value);
    if (searchTerm) {
      const results = productsData.filter((product) =>
        product.name.toLowerCase().includes(searchTerm.toLowerCase())
      );
      setSearchResults(results);
    } else {
      setSearchResults([]); // Clear search results if the search term is empty
    }
  };

  const handleCategoryClick = (categoryName) => {
    setSelectedCategory(categoryName);
  };

  const filteredProducts = selectedCategory
    ? productsData.filter((product) => product.category === selectedCategory)
    : productsData;


  return (
    <div className="app-container">
      {/* Header */}
      <header>
        <div className="search-bar">
          <input
            type="text"
            placeholder="Search for products..."
            value={searchTerm}
            onChange={handleSearchChange}
          />
          <button type="submit"><FaSearch /></button>
        </div>
      </header>

      {/* Top Categories */}
      <section className="top-categories">
        <h2>Top Categories</h2>
        <div className="category-cards">
          {categoriesData.map((category) => (
            <div
              key={category.id}
              className="category-card"
              onClick={() => handleCategoryClick(category.name)}
            >
              <img src={category.image} alt={category.name} />
              <span>{category.name}</span>
            </div>
          ))}
        </div>
      </section>

      {/* Product Cards */}
      <section className="product-cards">
        <h2>{selectedCategory}</h2>
        <div className="products">
          {filteredProducts.map((product) => (
            <div key={product.id} className="product-card">
              <img src={placeholderImage} alt={product.name} />
              <h3>{product.name}</h3>
              <span>per unit</span>
            </div>
          ))}
        </div>
      </section>

      {/* Footer */}
      <footer>
        <nav>
          <ul>
            <li><a href="/home"><FaHome /> Home</a></li>
            <li><a href="/categories"><FaList /> Categories</a></li>
            <li><a href="/cart"><FaShoppingBag /> Bag</a></li>
            <li><a href="/orders"><FaHistory /> Orders</a></li>
          </ul>
        </nav>
      </footer>
    </div>
  );
}

export default App;
